chrome.storage.local.get(['cities_dns'], function(result) {
    if(result.cities_dns != undefined && result.cities_dns != null && result.cities_dns != "") citys = JSON.parse(result.cities_dns);

    citys = test_citys;
    setTimeout(loadPage, 500);
});

function sendCity(id) {
    var injectedCode = "changeCity('"+citys[id][1]+"');";
    var script = document.createElement('script');
    script.appendChild(document.createTextNode(''+ injectedCode +''));
    (document.body || document.head || document.documentElement).appendChild(script);
}
function addButton() {
    var button = jQuery(".current-price-value");
    if(button.length > 0) jQuery(".current-price-value").after(" <a href='#' class='button-check-price-cities'>?</a>");
    else
    {
        jQuery(".product-item-rating").before("<a href='#' style='font-size: 30px;font-weight:bold;' class='button-check-price-cities'>?</a><br>");
    }
}

function loadPage()
{
    var scp = localStorage.getItem('startSerachingProcess'); // берем инфу о процессе поиска цены
    if(scp == null) // если процесс поиска не начался
    {
        setTimeout(addButton, 1000);

        jQuery(document).on('click', '.button-check-price-cities', function(e){
            e.preventDefault();
            var resultQ = confirm("Внимание, процесс поиска цены может занять продолжительное время. Начинаем?");
            if(resultQ)
            {
                localStorage.setItem('startSerachingProcess', 1);
                localStorage.setItem('searchIndex', 1);
                localStorage.setItem('pageSearch',window.location.toString());
                sendCity(0);
            }
            return false;
        });
    }
    else // если процесс поиска еборит
    {
        var searchIndex = parseInt(localStorage.getItem('searchIndex')), arrayResult = (searchIndex == 1 ? [] : JSON.parse(localStorage.getItem('arrayResult'))),
        searchPage = localStorage.getItem('pageSearch');
        jQuery("body").prepend("<div id='block-result-dns' style='width:350px;position:fixed;top:0;left:0;z-index:999999;background:#fff;text-align:center;padding:3px;border:solid 4px #5e5e5e;'></div>");
        if(searchPage.indexOf(window.location.toString()) == -1 && window.location.toString().indexOf(searchPage) == -1)
        {
            jQuery(document).on('click', '#button-cancel-search', function(e){
                e.preventDefault();
                var resultQ = confirm("Вы точно хотите прервать поиск?");
                if(resultQ)
                {
                    localStorage.removeItem("startSerachingProcess");
                    localStorage.removeItem("searchIndex");
                    localStorage.removeItem("arrayResult");
                    jQuery("#block-result-dns").remove();
                }
                return false;
            });

            jQuery("#block-result-dns").append("В данный момент активирован поиск цен на другой странице.<br><a href='#' id='button-cancel-search' style='float:left;'>Отменить поиск</a> <a href='"+
            searchPage+"' style='float:right;'>Перейти на страницу поиска</a>");
        }
        else
        {
            var price = jQuery(".current-price-value").attr("data-price-value"), // Цена
			isButtonAlert = jQuery(".col-header.col-order").find(".btn-primary.btn-price-item-alert").length; // Кнопка "Уведомить", значит купить нельзя в этом городе
            jQuery("#block-result-dns").append(searchIndex+"/"+citys.length+"<br><div style='width:100%;height:20px;background:#ffdf63;'><div style='width:"+
            (Math.round((100/citys.length)*searchIndex))+
            "%;height:20px;background:#b8ea5b;'></div></div><div id='result-search-dns' style='width:100%;overflow-y:auto;height:250px;display:none;'></div>");

            if(price != undefined && price != null && price.length > 0)
            {
                arrayResult.push(
				[ 
					jQuery(".header-top-menu__common-link .city-select").text().trim(), // 
					parseInt(price.trim()),
					isButtonAlert
				]);
                localStorage.setItem('arrayResult', JSON.stringify(arrayResult));
            }
            if(searchIndex < citys.length)
            {
                localStorage.setItem('searchIndex', searchIndex+1);
                sendCity(searchIndex);
            }
            else
            {
                localStorage.removeItem("startSerachingProcess");
                localStorage.removeItem("searchIndex");
                localStorage.removeItem("arrayResult");
                for(var i = 0; i < arrayResult.length; i++)
                {
                    for(var j = 0; j < arrayResult.length; j++)
                    {
                        if(arrayResult[i][1] < arrayResult[j][1]) { var tempp = arrayResult[i]; arrayResult[i] = arrayResult[j]; arrayResult[j] = tempp; }
                    }
                }
                var textResult = "";
                for(var i = 0; i < arrayResult.length; i++)
                {
					var isCanBuy = (arrayResult[i][2] > 0 ? 
					"<span style='color:#ef625d;font-weight:bold;font-size:20px;'>-</span>" : 
					"<span style='color:#2fda10;font-weight:bold;font-size:20px;'>+</span>");
                    textResult += "Город: '"+arrayResult[i][0].trim()+"' Цена: '"+arrayResult[i][1]+"' " + isCanBuy + "<br>";
                }
                if(arrayResult.length <= 0) textResult = "Нет доступных результатов";
                jQuery("#result-search-dns").html(textResult);
                jQuery("#result-search-dns").css('display','block');
            }
        }
    }
}
